{
    "openapi": "3.0.0",
    "info": {
        "title": "RentX Documentation",
        "description": "This is an API rent",
        "version": "1.0.0",
        "contact": {
            "email": "gabrielle.clima23@gmail.com"
        }
    },
    "paths": {
        "/categories": {
            "post": {
                "tags": [
                    "Category"
                ],
                "summary": "Create category",
                "description": "Create a new Category",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "type": "object",
                                "properties": {
                                    "name": {
                                        "type": "string"
                                    },
                                    "description": {
                                        "type": "string"
                                    }
                                },
                                "example": {
                                    "name": "create category sample",
                                    "description": "create category description sample"
                                }
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "created"
                    },
                    "501": {
                        "description": "category already exist"
                    }
                }
            },
            "get": {
                "tags": [
                    "Category"
                ],
                "summary": "List all categories",
                "description": "List all categories",
                "content": {
                    "application/json": {
                        "schema": {
                            "type": "array",
                            "itens": {
                                "type": "object",
                                "properties": {
                                    "name": {
                                        "type": "string"
                                    },
                                    "description": {
                                        "type": "string"
                                    }
                                }
                            }
                        }
                    }
                },
                "responses": {
                    "200": {
                        "description": "OK"
                    }
                }
            }
        },
        "/categories/import": {
            "post": {
                "tags": [
                    "Category"
                ],
                "summary": "Upload a new category",
                "description": "Upload a new category",
                "requestBody": {
                    "content": {
                        "multipart/form-data": {
                            "schema": {
                                "type": "object",
                                "properties": {
                                    "file": {
                                        "type": "string",
                                        "format": "binary"
                                    }
                                }
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "Created"
                    }
                }
            }
        },
        "/specifications": {
            "post": {
                "tags": [
                    "Specifications"
                ],
                "summary": "Create specification",
                "description": "Create a new specification",
                "requestBody": {
                    "content": {
                        "application/json": {
                            "schema": {
                                "$ref": "#/definitions/Specification"
                            }
                        }
                    }
                },
                "responses": {
                    "201": {
                        "description": "Created"
                    },
                    "500": {
                        "description": "Specification arleady exists"
                    }
                }
            }
        }
    },
    "definitions": {
        "Specification": {
            "type": "object",
            "properties": {
                "name": {
                    "type": "string"
                },
                "description": {
                    "type": "string"
                }
            }
        }
    }
}
